import React from "react";
import "./AddUser.css";

const AddUser = () => {
  return (
    <form>
      <div>
        <lable>UserName</lable>
        <input type="text"></input>
        <lable>Age(years)</lable>
        <input type="text"></input>
      </div>
    </form>
  );
};

export default AddUser;
